import React from "react";
import styled from "styled-components";
import Track from "./Track";
import fearless from "../assets/fearless.png";

const Wrapper = styled.div`
background-color: #d9c78f;
`

const Ul = styled.ul`{
  display: flex;
  gap: 10px;
  flex-direction: column;
  align-items: center;
  padding: 0;
  // background-color: #d9c78f;
  width: fit-content;
  padding: 0 10px;
  margin: 0 auto;
}`

const Li = styled.li`{
  list-style: none;
  text-transform: uppercase;
  font-weight: 500;
  color: white;
  font-size: 1rem;
};`

export default function Tracks({ tracks, handleToggle }) {


  return (
    <div>
      <h1>Fearless (Taylor's Version)</h1>
      <Ul>
        {tracks.map((track, i) => {
          return (
            <Li>
              <Track track={track} handleToggle={handleToggle} key={i} />
            </Li>
          )
        }
        )}
      </Ul>
      <img src={fearless} alt="Fearless (Taylor's Version)" />
    </div>
  );
}
